import React, { useState, useEffect } from 'react';
import './Data.css';
import { deleteUser } from './dataActions';
import { connect } from 'react-redux';

const Data = ({ deleteUser }) => {
    const [users, setUsers] = useState([]);
    const [error, setError] = useState(null);
    const [updMail, setUpdMail] = useState('');
    const [updPassword, setUpdPassword] = useState('');
    const [updName, setUpdName] = useState('');
    const [updSurname, setUpdSurname] = useState('');
    const [updAge, setUpdAge] = useState(0);
    const [updAbout, setUpdAbout] = useState('');
    const [updGender_id, setUpdGender_id] = useState(0);
    const [updUser_id, setUpdUser_id] = useState(0);

    useEffect(() => {
        fetchData();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        switch (name) {
            case 'updAge':
                setUpdAge(value === '' ? '' : +value);
                break;
            case 'updGender_id':
                setUpdGender_id(value === 'male' ? 1 : 2);
                break;
            default:
                break;
        }
    };

    const fetchData = async () => {
        try {
            const response = await fetch('http://localhost:8080/api/users');
            const data = await response.json();
            setUsers(data);
            setError(null);
            const selectedUser = data[0];
            setUpdMail(selectedUser.mail);
            setUpdPassword(selectedUser.password);
            setUpdName(selectedUser.name);
            setUpdSurname(selectedUser.surname);
            setUpdAge(selectedUser.age);
            setUpdAbout(selectedUser.about);
            setUpdGender_id(selectedUser.gender.gender);
            setUpdUser_id(selectedUser.user_id);
        } catch (error) {
            setError(error);
        }
    };

    const deleteData = (id) => {
        deleteUser(id);
        fetch(`http://localhost:8080/api/delete-user/${id}`, {
            method: 'DELETE',
        }).then((response) => response.json());
    };

    const selectUser = (id) => {
        const selectedUser = users.find((user) => user.id === id);
        setUpdMail(selectedUser.mail);
        setUpdPassword(selectedUser.password);
        setUpdName(selectedUser.name);
        setUpdSurname(selectedUser.surname);
        setUpdAge(selectedUser.age);
        setUpdAbout(selectedUser.about);
        setUpdGender_id(selectedUser.gender.gender);
        setUpdUser_id(selectedUser.id);
    };

    const updateData = () => {
        const mail = updMail;
        const password = updPassword;
        const name = updName;
        const surname = updSurname;
        const age = updAge;
        const about = updAbout;
        const gender_id = updGender_id;
        const updateThisUser = updUser_id;
        const newData = { mail, password, name, surname, age, about, gender_id };
        console.log(newData);
        fetch(`http://localhost:8080/api/update-user/${updateThisUser}`, {
            method: 'PUT',
            headers: { 'content-type': 'application/json' },
            body: JSON.stringify(newData),
        }).then((response) => {
            response.json().then((resp) => {
                fetchData();
            });
        });
    };

    if (error) {
        throw error;
    }

    return (
        <div className="dataContainer">
            <h2>Users</h2>
            <table className="table table-dark">
                <thead>
                <tr>
                    <th>Mail</th>
                    <th>Password</th>
                    <th>Name</th>
                    <th>Surname</th>
                    <th>Age</th>
                    <th>Gender</th>
                    <th>Role</th>
                    <th>RC</th>
                    <th>About</th>
                    <th>Delete</th>
                    <th>Update</th>
                </tr>
                </thead>
                <tbody>
                {users.map((user) => (
                    <tr key={user.id}>
                        <td>{user.mail}</td>
                        <td>{user.password}</td>
                        <td>{user.name}</td>
                        <td>{user.surname}</td>
                        <td>{user.age}</td>
                        <td>{user.gender.gender}</td>
                        <td>{user.rolesList[0].role}</td>
                        <td>{user.regularCustomer.id}</td>
                        <td>{user.about}</td>
                        <td>
                            <button
                                onClick={() => deleteData(user.id)}
                                className="btn btn-danger"
                            >
                                Delete
                            </button>
                        </td>
                        <td>
                            <button
                                onClick={() => selectUser(user.id)}
                                className="btn btn-light"
                            >
                                Update
                            </button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>

            <div className="container-sm">
                <div className="card">
                    <div className="card-header">
                        <h3>Updating User</h3>
                    </div>
                    <div className="card-body">
                        <div className="row">
                            <div className="form-group">
                                <label>Mail</label>
                                <input
                                    name="updMail"
                                    value={updMail}
                                    onChange={handleChange}
                                    className="form-control"
                                ></input>
                            </div>

                            <div className="form-group">
                                <label>Password </label>
                                <input
                                    name="updPassword"
                                    value={updPassword}
                                    onChange={handleChange}
                                    type=""
                                    className="form-control"
                                ></input>
                            </div>

                            <div className="form-group">
                                <label>Name</label>
                                <input
                                    name="updName"
                                    value={updName}
                                    onChange={handleChange}
                                    className="form-control"
                                ></input>
                            </div>
                            <div className="form-group">
                                <label>Surname</label>
                                <input
                                    name="updSurname"
                                    value={updSurname}
                                    onChange={handleChange}
                                    className="form-control"
                                ></input>
                            </div>
                            <div className="form-group">
                                <label>Age</label>
                                <input
                                    name="updAge"
                                    value={updAge}
                                    onChange={handleChange}
                                    type="numeric"
                                    className="form-control"
                                ></input>
                            </div>
                            <div className="form-group">
                                <label>About</label>
                                <input
                                    name="updAbout"
                                    value={updAbout}
                                    onChange={handleChange}
                                    className="form-control"
                                ></input>
                            </div>

                            <div className="form-group">
                                <label>Gender</label>
                                <br></br>
                                <input
                                    className="form-check"
                                    type="checkbox"
                                    checked={updGender_id === 1}
                                    onChange={() => setUpdGender_id(1)}
                                    name="updGender_id"
                                    value="male"
                                ></input>
                                <label>Male</label>
                                <input
                                    className="form-check"
                                    type="checkbox"
                                    checked={updGender_id === 2}
                                    onChange={() => setUpdGender_id(2)}
                                    name="updGender_id"
                                    value="female"
                                ></input>
                                <label>Female</label>
                            </div>
                        </div>
                    </div>
                    <div className="card-footer">
                        <button
                            onClick={updateData}
                            type="submit"
                            className="btn btn-secondary"
                        >
                            Update
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

const mapDispatchToProps = {
    deleteUser,
};

export default connect(null, mapDispatchToProps)(Data);
